import { award } from "./pages/award"
import { blog } from "./pages/blog"
import { Contact } from "./pages/contact"
import { Home } from "./pages/Home"
import { ADMIN_ROUTE, AWARD_ROUTE, BLOG_ROUTE, BLOG_SINGLE_ROUTE, CONTACT_ROUTE, HOMEPAGE_ROUTE } from "./utils/consts"

export const authRoutes = [
    {
      path: ADMIN_ROUTE,
      Component : Admin  
    },
    {
      path: CREATE_FOTTBALLER_ROUTE,
      Component : CreateFootballer  
    }
]
export const publicRoutes = [
    {
        path: HOMEPAGE_ROUTE,
        Component : Home  
    },
    {
        path: BLOG_ROUTE,
        Component : blog  
    },
    {
        path: AWARD_ROUTE,
        Component : award  
    },
    {
        path: CONTACT_ROUTE,
        Component : Contact  
    },
    {
        path: BLOG_SINGLE_ROUTE + '/:id',
        Component : Contact  
    }

]
